import '../components.css'
import { Link } from 'react-router-dom';
import PostJob from '../pages/post_job';
import { useState } from 'react';

const   Header = () =>{

    const [hamburgerState, setHamburgerState] = useState(false);
    const handleHamburgerMenu = () =>{
        setHamburgerState(!hamburgerState);

    }


    return(
        <>

        <header >

            <nav>
                <ul style={{border: "solid"}}>
                    <li style={{ marginRight: "80px" }}><Link className='Link' to='/'>Jobba Hub</Link> </li>
                    <li><Link className='Link' to='/post-job/'>Post Job Opening</Link></li>
                    <li><Link to={"login"}>Sign in</Link></li> 

                </ul>
                <div onClick={handleHamburgerMenu} style={{ border: "solid", width: "40px", height: "20px", display: "flex", alignItems: "center", marginLeft: "50px",  justifyContent: "center", cursor: "pointer"}}> = </div>
            </nav>

            {hamburgerState && (
                <>
            <div style={{ width: "200px", height: "200px",  zIndex: "1", position: "absolute", top: "5%", left: "50%", backgroundColor: "green" }}>
                <ul>
                    <li style={{padding: "10px", textAlign: 'center' }}><Link style={{ textDecoration: "none", color: "White", textAlign: "center" }} to="to='http://127.0.0.1:1111/api/v1/logout/'>" >Logout</Link></li>
                    <hr/>
                    <li style={{ padding: "10px", textAlign: 'center' }}><Link style={{ textDecoration: "none", color: "White", textAlign: "center" }} to="/profile" >Profile</Link></li>
                    <hr/>
                    <li style={{ padding: "10px", textAlign: 'center' }}><Link style={{ textDecoration: "none", color: "White", textAlign: "center" }} to="" >Job Applications</Link></li>
                    <hr/>
                    <li style={{padding: "10px", textAlign: 'center' }}><Link style={{ textDecoration: "none", color: "White", textAlign: "center" }} to="" >Jobs Posted</Link></li>
                    <hr/>
                </ul>



            </div>
            </>
        )}

        </header>

        </>

    );
}


export default Header;
